Приложение позволяет регистрироваться на игры от Ruda Games.


Для регистрации на игру:

1. Нужно открыть вкладку "Регистрация";
2. Выбрать в выпадающем списке нужную игру (после выбора игры будут отображены данные игры: место и время игры, дата начала регистрации, а также баннер игры);
3. Выбрать в выпадающем списке нужную команду;
4. Указать количество игроков;
5. Указать имя и номер телефона капитана команды;
6. Нажать кнопку "Зарегистрироваться".

Если все данные указаны верно и время для регистрации уже наступило, то в текстовом поле справа отобразится сообщение об успешной регистрации.

Если какие-то данные заполнены неверно, то появится сообщение с ошибкой.

Если дата регистрации еще не наступила, то в текстовом поле справа отобразится сообщение, что запрос на регистрацию принят. Регистрация осуществится автоматически, как только наступит время для регистрации, главное - не закрывать приложение! Приложение позволяет регистрироваться сразу на несколько игр.


Для отмены игры:

Все актуальные регистрации на игры отображаются на вкладке "Мои игры".

Чтобы отменить игру, нужно перейти на вкладку "Мои игры" и нажать на кнопку "Оменить регистрацию" у блока с нужной игрой.
